// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PriceTransfer {

    address public sender;
    address public receiver;
    uint256 public price;
    bool public isTransferred;

    event TransferCompleted(address indexed sender, address indexed receiver, uint256 price);

    constructor(address _receiver) {
        sender = msg.sender;
        receiver = _receiver;
        isTransferred = false;
    }

    modifier onlySender() {
        require(msg.sender == sender, "Only the sender can call this function");
        _;
    }

    modifier notTransferred() {
        require(!isTransferred, "The amount has already been transferred");
        _;
    }

    function transferAmount() external payable onlySender notTransferred {
        require(msg.value > 0, "Invalid amount");

        isTransferred = true;
        price = msg.value;
        emit TransferCompleted(sender, receiver, price);

        // Transfer the payment to the receiver
        payable(receiver).transfer(price);
    }
}
contract give{
    struct property{
        string name;
        address owner;
    }

    mapping(uint256=>property)propertyMap;
    uint256 public id=0;
    function addProperty(string calldata _name,address _owner)public{
        propertyMap[id]=property(_name,_owner);
        id++;
    }
    function giveproperty(uint256 _id)public view returns(property[] memory){

        property[] memory array= new property[](id);
        for(uint i=1;i<id;i++){
            array[i-1]=propertyMap[i];
        }
        return array; 
    }
}
